import React from "react";
import { Card } from "./styles";

const BorderCard = ({
  src = "/images/icon-facebook.svg",
  username = "diego9497",
  followers,
  followersChange,
  change,
}) => {
  return (
    <Card>
      <p>
        <img src={src} alt="" />
        <span>{username}</span>
      </p>
    </Card>
  );
};
export default BorderCard;
